                        <NavLink to="./contact" activeStyle>CONTACT</NavLink>
                        <NavLink to="./blog" activeStyle>BLOG</NavLink>
                        <NavLink to="./about" activeStyle>ABOUT</NavLink>
                    </NavMenu>
                </Nav>
            </NavContainer>
            </NavbarContainer>
        </TopContainer>
        
        </HeaderContainer>
    )
};

